export default function MovieData() {
const [MovieData,setMovieData]= useState("")

useEffect(()=>{
   async function Movie(){
const response= await fetch("https://api.themoviedb.org/3/search/movie?api_key=61a165cb4b595b07d284dbedb9ee6473&query=ddfddfdfdf")
console.log("response",response)  
return await response.json();
}
Movie()
})

  return (
    <div>MovieData</div>
  )
}
